import styled from 'styled-components'
import Video from '../videos/video.mp4'

const Container = styled.div`
    margin-top: -60px;
    margin-left: 0;
    margin-right: 0;
    background: #f6f1cb;
    display: block;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 100%;
    position: absolute;
    z-index: 1;
`
const SearchBox = styled.div`
    margin-top: 90px;
    margin-left: auto;
    margin-right: auto;
    display: flex;
    background-color: #283618;
    width: 80%;
    height: 130px;
    border-radius: 5px;
    box-shadow: 0 4px 8px 5px rgba(0, 0, 0, 0.2), 0 15px 20px 5px rgba(0, 0, 0, 0.19);
    overflow: hidden;
`
const SearchResults = styled.div`
    width: 80%;
    position: relative;
    height: 100%;
    margin-top: 10px;
    margin-left: auto;
    margin-right: auto;
    background: #232134;
    overflow: auto;
    border-radius: 5px;
    box-shadow: 0 4px 8px 5px rgba(0, 0, 0, 0.2), 0 15px 20px 5px rgba(0, 0, 0, 0.19);
`

const SearchElements = () => {
    return (
        <Container>
            <SearchBox/>
            <SearchResults/>
        </Container>
    )
}

export default SearchElements
